import React from 'react'

const Footer = () => {
    const fcss = {
            backgroundColor: '#333',
            color: '#fff',
            padding: '20px 0',
            marginTop: '80px',
            marginBottom: 0
        }
    
  return (
    <>
    <p style={fcss}>COPYRIGHT(C) 2024 Nike, Inc. All Rights Reserved</p>
    </>
  )
}

export default Footer
